package hankerrank;

import java.util.Collections;
import java.util.HashMap;
import java.util.Map;

import collections.Main;

public class SherlockValidString {

    // Complete the isValid function below.
    static String isValid(String s) {
    	
    	Map<Character,Integer> map = new HashMap<Character,Integer>();
    	Map<Integer,Integer> mapValues = new HashMap<Integer,Integer>();
    	for (int i = 0; i < s.length(); i++) {
    		map.put(s.charAt(i), map.getOrDefault(s.charAt(i), 0)+1);			
		}

        for (Character key : map.keySet()) {
            mapValues.put(map.get(key), mapValues.getOrDefault(map.get(key), 0)+1);
        }
        if(mapValues.size()>2) {
            return "NO";
        }
        if(mapValues.size()==2&&mapValues.containsValue(1)) {
            int min = Collections.min(mapValues.keySet());
            int max = Collections.max(mapValues.keySet());
            if((mapValues.get(max)==1&&max-min==1)||(mapValues.get(min)==1&&min==1)){                
                return "YES";
            }
        }
        if(mapValues.size()==1){
            return "YES";
            }
        return "NO";
        }


    public static void main(String[] args) {
    	String str1="";
    	System.out.println(isValid(str1));
    }
}
